from typing import List


def concatenate(strings: List[str]) -> str:
    """ Concatenate list of strings into a single string
    >>> concatenate([])
    ''
    >>> concatenate(['a', 'b', 'c'])
    'abc'
    """
    if strings == []:
        return ''
    if strings == ['']:
        return strings[0]
    return ''.join([strings[0]] + [strings[1]] for _ in range(len(strings) - 1))

